INSERT INTO `douyin_aweme_comment` VALUES (3079, '103579003251', 'MS4wLjABAAAAKA_yWmXYDECLuS5HtEsA1KFgstu-Y6dhWdB5JN_WyoM', '1353201076', '', '沧海过客', 'https://p3-pc.douyinpic.com/aweme/720x720/aweme-avatar/tos-cn-i-0813c001_oQxDAAaD9CfbopCqmgAppIAmEARklOnMKalAeC.jpeg?from=2956013662', '天下风云出我辈，一入江湖岁月催，皇图霸业谈笑中，不胜人生一场醉。提剑跨骑挥鬼雨，白骨如山鸟惊飞。尘事如潮人如水，只叹江湖几人回。夜雨八方战孤城，平明剑气看刀声。侠骨千年寻不见，碧血红叶醉秋风 （江湖行）。', '新西兰', 1711205578464, 1711205578462, '7283210582411952953', '7280854932641664319', '笑昏，胶水语言跟底层语言比毛线。Python好用适合小白，但不好维护。引用的外包越多，维护越难。系统升一次级死一批脑细胞，有些外包断更了，接口变更了又死一批脑细胞', 1695754722, '0');
