INSERT INTO `douyin_aweme_comment` VALUES (3082, '1965567129956647', 'MS4wLjABAAAAyjypLx73_u9rIfysb27T1fl85GMfeR_0-j_b4NqMiEMI_T1jd_00XKxoE0FT870x', '2938347826', 'dymz52gp33jp', '用户9186609502299', 'https://p3-pc.douyinpic.com/aweme/720x720/aweme-avatar/mosaic-legacy_3795_3044413937.jpeg?from=2956013662', '', '上海', 1711205578479, 1711205578477, '7281130552097801015', '7280854932641664319', '主要ai就是个扯淡技术，模型三天两头改，用c写不头要撞墙？而且Python有个大优势，就是很方便用c写模块。py本质就是一个脚本语言，大部分情况下用于替代perl，bash', 1695270325, '0');
